g2:c.PROCEDURE.g2:a.TEXT:
indirect-call-1-test (node : class benchmark-node)
result: value;

begin
  {Test indirect call.}
 
  result = call-function (the function-definition named by the method of indirect-call-1-test-object, indirect-call-1-test-object);
 
  result = call-function (the function-definition named by result, indirect-call-1-test-object);

  if result is indirect-call-1-class-def-method
  then call pass (node)
  else call fail (node, {failed} "to retrieve value.");

end

subtests-complete(node: class benchmark-test-with-subtests)
report: class message = the message that is the-report-of node;
log-inner-name: symbol = the symbol log-inner;
info-message: text;


{Since each subtest is reported back to the supervisor individually, no call is made from here to the supervisor, unless we have a mismatch between passed and count, in which case this mismatch is reported as a failure.}

begin
  if the number-of-subtests of node = the number-of-passed-subtests of node then begin
    conclude that the test-result of node is passed;
    change the text of report to "Passed.";
  end else begin
    conclude that the test-result of node is failed;
    info-message = "Number of subtests = [the number-of-subtests of node], but [the number-of-passed-subtests of node] passed.";
    conclude that the test-info of the test-result of node = info-message;
    if reg-utils-loaded is yes then
      call the procedure named by log-inner-name(the name of node, the symbol trouble, info-message);
    change the text of report to info-message;
  end;
end

fail-subtest(node: class benchmark-test-with-subtests, subtest-name: symbol, description:text)
report: class message = the message that is the-report-of node;
log-inner-name: symbol = the symbol log-inner;

begin
  if reg-utils-loaded is yes then
    call the procedure named by log-inner-name(subtest-name, the symbol trouble, description);
  change the text of report to "Subtest [subtest-name] failed, [description].";
  inform the operator that "Subtext [subtest-name] of [the name of node] failed with report: [description].";
end

pass-subtest(node: class benchmark-test-with-subtests, subtest-name: symbol)
report: class message = the message that is the-report-of node;
passed-count: integer = the number-of-passed-subtests of node + 1;
log-inner-name: symbol = the symbol log-inner;

begin
  if reg-utils-loaded is yes then
    call the procedure named by log-inner-name(subtest-name, the symbol ok, "");
  conclude that the number-of-passed-subtests of node= passed-count;
  change the text of report to "Subtest [subtest-name] passed.";
end

pass-with-report (node: class benchmark-node, report-text: text)
report: class message = the message that is the-report-of node;
log-ok-name: symbol = the symbol log-pass-with-report;

begin
  change the text of report to report-text;
  if reg-utils-loaded is yes
  then call the procedure named by log-ok-name (node, report-text);

  conclude that the test-result of node is passed;
end

{Begin-test will call the regression-test facilities function start-test.  Once completed, then start the begin-benchmark procedure on every start-flow node in the knowledge base.}

begin-test ()
node : class benchmark-node;
start-test-name: symbol = the symbol start-test;

begin
  if not(begin-tests-when-g2-is-started) then return;

    conclude that the initial-value of start-time-text = "[the current real time as a time stamp]";

  if reg-utils-loaded is yes then call the procedure named by start-test-name (test-suite-name);
  
  call activate-profiling-tools ();

  for node = each start-flow do
    allow other processing;
    call get-total-benchmark-test(node);
    call start-benchmark-node (node,node);
  end;
end

start-benchmark-node (node : class benchmark-node,go-node : class start-flow)
proc-name: symbol;
error-type: symbol;
error-text: text;

begin
  {Invoke test, catching aborts & timeouts}

  {Show workspace of this node if first one on WS}
  if show-testing-racetracks then begin
  if node is a start-flow then show the workspace of node;
  if there exists a connection post connected to node then show the workspace of node;
  end; {if show-testing-racetracks}

  call initialize-benchmark-node (node,go-node);

  if the test-procedure of node is compose-from-test-name then proc-name = symbol ("[the name of node]-test")
      else proc-name = the test-procedure of node;

  if not (there exists a procedure named by proc-name)
  then call fail (node, "Couldn't find test procedure [proc-name].");
  
  if the test-result of node is not-yet-run then
    begin
      do in parallel until one completes
          wait for 3 * the timeout-limit of node;
          wait until the test-result of node is not not-yet-run checking every 1 second; 
            call the procedure named by proc-name (node);
      end;
    end
    on error (error-type, error-text) 
        if the expected-test-result of node is aborted 
        then call pass (node)
        else call fail (node, "Aborted unexpectedly<<<[error-type]: [error-text]>>>");
    end;

  if the test-result of node is not-yet-run 
    and the expected-test-result of node is not aborted 
    and node is a benchmark-test then
  begin
    if the expected-test-result of node is timed-out
    then call pass (node)
    else call fail (node, "Timed-out unexpectedly");
  end;

if node is a benchmark-test then
    begin
        conclude that the number-of-executed-tests of go-node = the number-of-executed-tests of go-node + 1;
        change the text of the message that is the-report-of go-node to "[100 * the number-of-executed-tests of go-node / the total-number-of-tests of go-node]%";
    end;
  call start-following-nodes (node,go-node);
end

initialize-benchmark-node (node : class benchmark-node,go-node : class start-flow)
sub-node : class benchmark-node;
report, old-report: class message;

begin
  if there exists a message old-report that is the-report-of node then delete old-report;

  create a message report; 
  transfer report to the workspace of node at (the item-x-position of node + 40, the item-y-position of node);
  conclude that report is the-report-of node;

  if node is a benchmark-test then 
    change the text of report to "[the first of the following expressions that has a current value 
            (the name of node, "unnamed-test")]"

  else if node is a start-flow then 
    begin
        change the text of report to "Start";
        change the text of the message that is the-report-of go-node to "0%";
    end

  else if node is an end-flow then
    begin
      change the text of report to "End";
      change the text of the message that is the-report-of go-node to "100%";
    end

end

start-following-nodes (node : class benchmark-node,go-node : class start-flow)
next-node : class benchmark-node;
count-next-nodes: integer;
begin
  count-next-nodes = 0;
//post "start following node: [the name of node]";
  for next-node = each benchmark-node connected to node do
//  post "next-node: [the name of next-node]";
    allow other processing;
    if the test-result of next-node is not-yet-run then begin
        start start-benchmark-node (next-node,go-node);
        count-next-nodes = count-next-nodes + 1;
    end;
  end;
//  post "count-next-nodes: [count-next-nodes]";
  if count-next-nodes = 0 and the class of node /= the symbol end-flow then begin
    post "class of node: [the class of node]";
    if the class of node = the symbol start-flow then
        call tsdriver-signal-error("there are no tests connected to the start/go node")
    else 
        call tsdriver-signal-error("there are no tests connected to test [the name of node]");
 
  end;
end

end-test (node : class end-flow)
finish-test-name: symbol = the symbol finish-test;
auto-test-dir-exist: truth-value ;
auto-test-dir: text;
rt : class readout-table;
begin
    conclude that the initial-value of end-time-text = "[the current real time as a time stamp]";
    
    if the names of the workspace of node exists then
    conclude that the initial-value of test-suite-name = "[the names of the workspace of node]";
    
  change the text of the message that is the-report-of node to "Tests completed. "; 
  
  if reg-utils-loaded is yes then 
   begin
     if (tests-failed is yes) then
      call the procedure named by finish-test-name (the symbol failed, "[test-suite-name] tests completed.")
    else
      call the procedure named by finish-test-name (the symbol passed, "[test-suite-name] tests completed.");
   end;
  if show-stats-when-racetrack-reaches-end then
    begin
      show the subworkspace of suite-result-presentation;
      for rt = each readout-table upon the subworkspace of suite-result-presentation do
        allow other processing;
        update rt;    
      end;
    end;
   
  auto-test-dir = call g2-get-environment-variable ("G2_AUTO_TEST") ;
  auto-test-dir-exist = call g2-directory-exists(auto-test-dir);
    if  auto-test-dir-exist and auto-test-dir /= "" then
    begin
        call g2-change-default-directory (auto-test-dir);
        conclude that test-suite-name = "[the top-level-module of module-information]" ;
        call stop-profiling-in-testing (test-suite-name);
        call write-suite-results (test-suite-name );
        shut down g2 ;
    end;    
end

start-start-flow (start-node : class start-flow)
total : integer ;
begin
    if the test-result of start-node is not-yet-run then
        begin
            conclude that the test-result of start-node is passed;
        end;
end

pass (node: class benchmark-node)
report: class message = the message that is the-report-of node;
log-ok-name: symbol = the symbol log-pass;

begin
  change the text of report to "Passed.";
  
  if reg-utils-loaded is yes
  then call the procedure named by log-ok-name (node);
   conclude that the test-result of node is passed;    
end

fail (node: class benchmark-node, test-info: text)
report: class message = the message that is the-report-of node;
log-trouble-name: symbol = the symbol log-fail;

begin
  change the text of report to "[the name of node] failed
[test-info]";
  
  if reg-utils-loaded is yes then 
  begin
    call the procedure named by log-trouble-name (node, test-info);
    conclude that tests-failed = the symbol yes;
  end;
  conclude that the test-result of node is failed;
  conclude that the test-info of the test-result of node = test-info;

end

test-procedure-starter (node: class benchmark-node)
proc-name: symbol;

begin
   if the test-procedure of node is compose-from-test-name then proc-name = symbol ("[the name of node]-test")
   else proc-name = the test-procedure of node;

   call the procedure named by proc-name (node);
end

get-childs(node : class benchmark-test) = (integer)
next-node : class benchmark-test;
total,childs : integer;

begin
    total = 0;
    for next-node = each benchmark-test connected to node do
        if the counted of next-node is false then
            begin
            conclude that the counted of next-node = true;
            childs = call get-childs(next-node);
            total = total + 1 + childs;
            end;
    end;
    return total;
end

get-total-benchmark-test(start-node : class start-flow )
total,childs : integer ;
next-node : class benchmark-test;

begin
    for next-node = each benchmark-test do
        conclude that the counted of next-node = false;
    end;
    
    total = 0;
    for next-node = each benchmark-test connected to start-node do
        if the counted of next-node is false then
            begin
            conclude that the counted of next-node = true;
            childs = call get-childs(next-node);
            total = total + 1 + childs;
            end;
    end;
    conclude that the number-of-executed-tests of start-node = 0;
    conclude that the total-number-of-tests of start-node = total;
    
    for next-node = each benchmark-test do
        conclude that the counted of next-node = false;
    end;
end

initialize-benchmark-node-2 (node : class benchmark-node)
sub-node : class benchmark-node;
report, old-report: class message;

begin
  if there exists a message old-report that is the-report-of node then delete old-report;

  create a message report; 
  transfer report to the workspace of node at (the item-x-position of node + 40, the item-y-position of node);
  conclude that report is the-report-of node;

  if node is a benchmark-test then 
    change the text of report to "[the first of the following expressions that has a current value 
            (the name of node, "unnamed-test")]"

end

tsdriver-signal-error(msg:text)
    err:class error;
begin
    create an error err;
    conclude that the error-description of err = msg;
    signal err;
end

file-io-module-is-present () = (truth-value)
err-sym: symbol;
err-txt: text;

begin
    if there exists a procedure PR such that (the name of PR is default-directory) then return true;

    inform the operator that "You must load (or require) the file-io-module module in order to read in or write a regression log.";
    return false;

{On error is needed since the there-exists clause will abort if there exists an UNNAMED procedure.}
end on error (err-sym, err-txt)
    inform the operator that "You must load (or require) the file-io-module module in order to read in or write a regression log.";
    return false; 
end

read-suite-log (suite-name: text)
node: class benchmark-test;
regression-filename, directory: text;
first-line-read, line: text;
stream: class g2-stream;
node-name, prev-result: symbol;
file-io-loaded: truth-value;
close-file-proc: class procedure
  = the procedure named by close-file-symbol;
read-line-proc: class procedure
  = the procedure named by read-line-symbol;
open-file-for-read-proc: class procedure
  = the procedure named by open-file-for-read-symbol;
default-directory-proc: class procedure
  = the procedure named by default-directory-symbol;

begin
   file-io-loaded = call file-io-module-is-present ();
   if not (file-io-loaded) then return;

   directory = call default-directory-proc ();
   regression-filename = "[directory][lower-case-text(test-suite-name)].rg";

   stream = call open-file-for-read-proc (regression-filename);
   transfer stream to this workspace at (0, 0);
   if the access-direction of stream is not input then
   begin
      inform the operator that "Couldn't open [regression-filename] for input.";
      return;
   end;

   first-line-read = call read-line-proc (stream);
   conclude that the previous-regression-status-line of the-test-suite = first-line-read;

   repeat
      line = call read-line-proc (stream);
      node-name, prev-result, line = call parse-two-symbols (line);
      exit if node-name is end-of-file;

      if there exists a benchmark-test NODE named by node-name then
      begin
         conclude that the previous-test-result of the test-result of NODE = prev-result;
         conclude that the test-info of the test-result of NODE = line;
      end
      else if not(line = "") then conclude that the number-of-deleted-tests of the-test-suite = the number-of-deleted-tests of the-test-suite + 1;

      if the g2-stream-status of stream is end-of-file-reached then begin
          inform the operator that "End of file reached prematurely while reading [regression-filename].";
          exit if true;
          end;
   end;

   call close-file-proc (stream);
   conclude that the previous-test-results-read-in of the-test-suite is yes;
end

write-suite-results (suite-name: text)
node: class benchmark-test;
regression-filename, directory: text;
err-sym: symbol;
err-txt: text;
stream: class g2-stream; 
auto-test-dir-exist: truth-value ;
auto-test-dir: text;
file-io-loaded: truth-value;
wsk: class kb-workspace;
smoketestpos: integer;
wsname: symbol;
smokerun: truth-value=false;

begin
   auto-test-dir = call g2-get-environment-variable ("G2_AUTO_TEST") ;
   auto-test-dir-exist = call g2-directory-exists(auto-test-dir);
    
    if not (auto-test-dir-exist) or auto-test-dir = "" then 
        return;
          
   {Make backup tilde file}
  begin {allow errors in here when file does not exist}
      call g2-delete-file ("test-results-log.rg~"); 
      call g2-rename-file ("test-results-log.rg", "test-results-log.rg~")
   end on error (err-sym, err-txt) {trap errors} end;
   
    call g2-change-default-directory (auto-test-dir);    

    conclude that test-suite-name = "[the top-level-module of module-information]" ;
  
  stream = call g2-open-file-for-append("test-results-log.rg",true);

   for wsk = each kb-workspace do
   if the name of wsk exists then
     begin
        wsname = the name of wsk;  
        smoketestpos = position-of-text ("SMOKETEST", "[wsname]");   
        if smoketestpos > 0 then
        begin
           smokerun = true;         
        end;
     end;
   end;

   inform the operator that "Writing to test-results-log. . .";
   
   if (smokerun) then
   begin
    call g2-write-line (stream, "Smoketest suite: [test-suite-name], written @ [the current time as a time stamp]");
   end;

   if not (smokerun) then
   begin
    call g2-write-line (stream, "[test-suite-name], written @ [the current time as a time stamp]");
   end; 

    call g2-write-line (stream, "");
   
    for node = each benchmark-test do
        call g2-write-line (stream, "[the name of node],[the test-result of node]");
        call g2-write-line (stream, "[the name of node],[the test-info of the test-result of node]"); 
    end;
   
    call g2-write-line (stream, "");

    if (smokerun) then
    begin
      call g2-write-line (stream, "Smoketest suite: end-of-file, [test-suite-name], [the current time]"); 
    end; 

    if not (smokerun) then 
    begin
    call g2-write-line (stream, "end-of-file, [test-suite-name], [the current time]");
    end;
    call g2-write-line (stream, "---------------------------------------------------------------------------------"); 
    call g2-close-file (stream);
    
  inform the operator that ". . .written.";
  if not (smokerun) then
     shut down g2 ;
end

get-next-token (txt: text) = (text, text)
tok: text;
comma-pos, len: integer;

begin
   len = length-of-text (txt);
   comma-pos = position-of-text (",", txt);
   if comma-pos <= 1 then return "", txt;

   return 
      get-from-text (txt, 1, comma-pos - 1),
      omit-from-text (txt, 1, comma-pos);
end

parse-two-symbols (txt: text) = (symbol, symbol, text)
test-name, test-status: text;
name-symbol, status-symbol: symbol;
error-symbol: symbol;
error-text: text;

{Parse a line from a previous regression report into the first 2 tokens.  Example:
"array-3, passed, @"with flying colors@""
==> array-3, passed.}

begin
   test-name, txt = call get-next-token (txt);
   if test-name = ""
   then return the symbol bad-record,
                   the symbol bad-record,
                   txt;
   name-symbol = symbol (test-name); 

   test-status, txt = call get-next-token (txt);
   if test-status = ""
   then return name-symbol, the symbol no-status, txt;
   status-symbol = symbol (test-status); 
   return name-symbol, status-symbol, txt;
   
end on error (error-symbol, error-text)
    return the symbol bad-record,
             the symbol bad-record,
             "";
end

g2:c.READOUT-TABLE.g2:a.EXPRESSION-TO-DISPLAY:
(if the PREVIOUS-TEST-RESULTS-READ-IN of the-test-suite is yes

then the count of each benchmark-test NODE such that (the previous-test-result of the test-result of NODE is not passed and the test-result of NODE is passed) 

else the symbol na)

(if the previous-test-results-read-in of the-test-suite is yes 

then the count of each benchmark-test NODE such that (the previous-test-result of the test-result of NODE is passed and the test-result of NODE is not passed)

else the symbol na)
